import React from 'react'
import {v4 as uuidv4} from 'uuid'

export const Todolist = ({todo, setTodo, input, setInput}) => {
  return (
    <div>{todo.map((todos) => {return(
        <ul><li key={todos.id}> {todos.title} </li></ul> )} ) }</div>
  )
}
